sprites.onOverlap(SpriteKind.Player, SpriteKind.Enemy, function (sprite, otherSprite) {
    if (sprites.readDataBoolean(sprite, "Attacking")) {
        if (sprites.readDataBoolean(otherSprite, "CanBeHit")) {
            if (otherSprite.isHittingTile(CollisionDirection.Bottom) && (Math.percentChance(Enemy_Dodge_Chance + 15) && (!(Multiplayer) && (sprites.readDataBoolean(otherSprite, "CanAttack") && (sprites.readDataBoolean(otherSprite, "CanBeHit") && !(sprites.readDataBoolean(otherSprite, "Attacking"))))))) {
                Dodge(otherSprite, Player2Character, 1)
            } else {
                otherSprite.vy += 0 - (sprites.readDataNumber(otherSprite, "HP") + sprites.readDataNumber(sprite, "Damage") / 2)
                otherSprite.vx = sprites.readDataNumber(sprite, "Dir") * 2
                otherSprite.setFlag(SpriteFlag.GhostThroughSprites, true)
                scene.cameraShake(4, 500)
                characterAnimations.setCharacterAnimationsEnabled(otherSprite, false)
                ToggleSpriteAttacking(otherSprite, false)
                SetSpriteHP(otherSprite, sprites.readDataNumber(sprite, "Damage") + sprites.readDataNumber(otherSprite, "HP"))
                if (sprites.readDataBoolean(sprite, "Drain")) {
                    if (sprites.readDataNumber(sprite, "HP") >= 10) {
                        SetSpriteHP(sprite, sprites.readDataNumber(sprite, "HP") - 10)
                    }
                }
                ToggleSpriteCanBeHit(otherSprite, false)
                animation.runImageAnimation(
                otherSprite,
                HitAnimations[Player2Character],
                100,
                false
                )
                pauseUntil(() => otherSprite.isHittingTile(CollisionDirection.Bottom))
                characterAnimations.setCharacterAnimationsEnabled(otherSprite, true)
                otherSprite.vx = 0
                ToggleSpriteCanBeHit(otherSprite, true)
                timer.after(300, function () {
                    otherSprite.setFlag(SpriteFlag.GhostThroughSprites, false)
                })
            }
        }
    }
})
sprites.onOverlap(SpriteKind.P2HandSelector, SpriteKind.PlayerBox, function (sprite, otherSprite) {
    if (controller.player2.isPressed(ControllerButton.A)) {
        animation.runImageAnimation(
        P2REFLECTCHARACTERIMAGE,
        AnimationIdleLeft[sprites.readDataNumber(otherSprite, "ID")],
        200,
        true
        )
        TextForP2.setText(Names[sprites.readDataNumber(otherSprite, "ID")])
        Player2Character = sprites.readDataNumber(otherSprite, "ID")
        if (Selected < MaximumPlayers) {
            P2READY = true
        }
    }
})
sprites.onCreated(SpriteKind.FallingThing, function (sprite) {
    sprite.y = 0
    sprite.vy = 70
    sprite.setFlag(SpriteFlag.DestroyOnWall, true)
})
sprites.onOverlap(SpriteKind.Player, SpriteKind.Trap, function (sprite, otherSprite) {
    if (sprites.readDataBoolean(sprite, "CanBeHit")) {
        sprites.destroy(otherSprite)
        scene.cameraShake(4, 500)
        characterAnimations.setCharacterAnimationsEnabled(sprite, false)
        sprite.vy += -65
        ToggleSpriteCanBeHit(sprite, false)
        ToggleSpriteAttacking(sprite, false)
        SetSpriteHP(sprite, sprites.readDataNumber(sprite, "HP") + 15)
        animation.runImageAnimation(
        sprite,
        HitAnimations[Player1Character],
        100,
        false
        )
        pauseUntil(() => sprite.isHittingTile(CollisionDirection.Bottom))
        characterAnimations.setCharacterAnimationsEnabled(sprite, true)
        timer.after(1000, function () {
            sprite.vx = 0
            ToggleSpriteCanBeHit(sprite, true)
        })
    }
})
