function DoTextSpriteInvisibilty (WhichText: Sprite) {
    WhichText.setFlag(SpriteFlag.Invisible, true)
    timer.after(500, function () {
        WhichText.setFlag(SpriteFlag.Invisible, false)
        timer.after(500, function () {
            DoTextSpriteInvisibilty(WhichText)
        })
    })
}
scene.onOverlapTile(SpriteKind.Player, assets.tile`myTile31`, function (sprite, location) {
    if (sprites.readDataNumber(sprite, "HP") < MaxHealth) {
        SetSpriteHP(sprite, MaxHealth)
    }
})
