function StartBotMovement (Selected: Sprite) {
    sprites.setDataNumber(Selected, "Dir", -100)
    spriteutils.onSpriteUpdateInterval(Selected, EnemyAttackCooldown - 40, function (sprite) {
        if (sprites.readDataBoolean(Selected, "CanBeHit")) {
            if (InBattle) {
                if (sprites.readDataSprite(Selected, "Enemy").x > Selected.x) {
                    sprites.setDataNumber(Selected, "Dir", 100)
                    sprites.setDataNumber(Selected, "VXMOVEMENT", SpeedStats[Player2Character])
                } else if (sprites.readDataSprite(Selected, "Enemy").x < Selected.x) {
                    sprites.setDataNumber(Selected, "Dir", -100)
                    sprites.setDataNumber(Selected, "VXMOVEMENT", SpeedStats[Player2Character] * -1)
                } else if (sprites.readDataSprite(Selected, "Enemy").x == Selected.x) {
                    sprites.setDataNumber(Selected, "VXMOVEMENT", 0)
                }
            }
        } else {
            sprites.setDataNumber(Selected, "VXMOVEMENT", 0)
        }
    })
    spriteutils.onSpriteUpdateInterval(Selected, EnemyAttackCooldown - 50, function (sprite) {
        if (InBattle) {
            if (sprites.readDataBoolean(Selected, "CanAttack") && (sprites.readDataBoolean(Selected, "CanBeHit") && !(sprites.readDataBoolean(Selected, "Attacking")))) {
                if (Math.percentChance(Enemy_Attack_Chance + 2) || spriteutils.distanceBetween(Selected, sprites.readDataSprite(Selected, "Enemy")) <= Enemy_Line_Of_Sight) {
                    sprites.setDataNumber(Selected, "AttackType", randint(0, 1))
                    if (sprites.readDataSprite(Selected, "Enemy").x > Selected.x) {
                        if (sprites.readDataNumber(Selected, "AttackType") == 0) {
                            sprites.setDataNumber(Selected, "PickAttack", randint(0, 2))
                            if (sprites.readDataNumber(Selected, "PickAttack") == 0) {
                                DoStandardAttack(Selected, Player2Character, Selected.isHittingTile(CollisionDirection.Bottom), false, false, 1)
                            } else if (sprites.readDataNumber(Selected, "PickAttack") == 1) {
                                DoStandardAttack(Selected, Player2Character, Selected.isHittingTile(CollisionDirection.Bottom), true, false, 1)
                            } else if (sprites.readDataNumber(Selected, "PickAttack") == 2) {
                                DoStandardAttack(Selected, Player2Character, Selected.isHittingTile(CollisionDirection.Bottom), false, true, 1)
                            }
                        } else if (sprites.readDataNumber(Selected, "AttackType") == 1) {
                            sprites.setDataNumber(Selected, "PickAttack", randint(0, 2))
                            if (sprites.readDataNumber(Selected, "PickAttack") == 0) {
                                console.log("BRight")
                                DoSpecialButtonMoves(Selected, Player2Character, true, false, false, 1)
                            } else if (sprites.readDataNumber(Selected, "PickAttack") == 1) {
                                console.log("BLeft")
                                DoSpecialButtonMoves(Selected, Player2Character, false, true, false, 1)
                            } else if (sprites.readDataNumber(Selected, "PickAttack") == 2) {
                                console.log("B")
                                DoSpecialButtonMoves(Selected, Player2Character, false, false, false, 1)
                            }
                        }
                    }
                }
            }
        }
    })
    spriteutils.onSpriteUpdateInterval(Selected, 1000, function (sprite) {
        if (sprites.readDataBoolean(Selected, "CanAttack") && (sprites.readDataBoolean(Selected, "CanBeHit") && !(sprites.readDataBoolean(Selected, "Attacking")))) {
            if (InBattle) {
                if (Math.percentChance(15) || (Selected.isHittingTile(CollisionDirection.Right) || Selected.isHittingTile(CollisionDirection.Left)) || sprites.readDataSprite(Selected, "Enemy").x > Selected.x) {
                    if (Selected.isHittingTile(CollisionDirection.Bottom)) {
                        Selected.vy += -180
                    }
                }
            }
        }
    })
}
sprites.onCreated(SpriteKind.GameBox, function (sprite) {
    sprite.x = GamemodeX
    sprite.y = GamemodeY
    GamemodeSelect.push(sprite)
    GamemodeX += 40
})
function SetSpriteDirection (Selected: Sprite, Value: number) {
    sprites.setDataNumber(Selected, "Dir", Value)
}
function SetSpriteHP (Selected: Sprite, Value: number) {
    sprites.setDataNumber(Selected, "HP", Value)
    timer.after(5, function () {
        if (sprites.readDataNumber(Selected, "HP") >= MaxHealth) {
            if (InBattle) {
                InBattle = false
                sprites.setDataBoolean(Selected, "CanAttack", false)
                sprites.setDataBoolean(Selected, "Attacking", false)
                sprites.setDataBoolean(Selected, "CanBeHit", false)
                sprites.setDataBoolean(sprites.readDataSprite(Selected, "Enemy"), "CanAttack", false)
                sprites.setDataBoolean(sprites.readDataSprite(Selected, "Enemy"), "CanBeHit", false)
                sprites.setDataBoolean(sprites.readDataSprite(Selected, "Enemy"), "Attacking", false)
                sprites.setDataBoolean(Selected, "Knockout", true)
                Selected.setStayInScreen(false)
                Selected.vy += -100
                Selected.setFlag(SpriteFlag.GhostThroughWalls, true)
                timer.after(2000, function () {
                    if (sprites.readDataBoolean(Player2, "Knockout")) {
                        info.changeScoreBy(1)
                    } else if (sprites.readDataBoolean(mySprite, "Knockout")) {
                        info.player2.changeScoreBy(1)
                    }
                    if (info.score() == PointsToWin) {
                        WinningPlayer = true
                        Win()
                    }
                    if (info.player2.score() == PointsToWin) {
                        WinningPlayer = false
                        Win()
                    }
                    if (!(info.score() == PointsToWin || info.player2.score() == PointsToWin)) {
                        sprites.destroyAllSpritesOfKind(SpriteKind.Text)
                        FadeToBlackWithPause(5000, false)
                        CommenceBattle(Multiplayer, true)
                    }
                })
            }
        }
    })
}
