function ToggleSpriteAttackable (Selected: Sprite, Attackable: boolean) {
    sprites.setDataBoolean(Selected, "CanAttack", Attackable)
}
sprites.onOverlap(SpriteKind.Projectile, SpriteKind.Enemy, function (sprite, otherSprite) {
    if (sprites.readDataBoolean(otherSprite, "CanBeHit")) {
        if (otherSprite.isHittingTile(CollisionDirection.Bottom) && (Math.percentChance(Enemy_Dodge_Chance + 15) && (!(Multiplayer) && (sprites.readDataBoolean(otherSprite, "CanAttack") && (sprites.readDataBoolean(otherSprite, "CanBeHit") && !(sprites.readDataBoolean(otherSprite, "Attacking"))))))) {
            Dodge(otherSprite, Player2Character, 1)
        } else {
            sprites.destroy(sprite)
            ToggleSpriteCanBeHit(otherSprite, false)
            otherSprite.vy += 0 - (sprites.readDataNumber(otherSprite, "HP") + sprites.readDataNumber(sprite, "Damage") / 2)
            otherSprite.vx = sprites.readDataNumber(sprite, "Dir") * 2
            otherSprite.setFlag(SpriteFlag.GhostThroughSprites, true)
            scene.cameraShake(4, 500)
            characterAnimations.setCharacterAnimationsEnabled(otherSprite, false)
            ToggleSpriteAttacking(otherSprite, false)
            SetSpriteHP(otherSprite, sprites.readDataNumber(sprite, "Damage") + sprites.readDataNumber(otherSprite, "HP"))
            animation.runImageAnimation(
            otherSprite,
            HitAnimations[Player2Character],
            100,
            false
            )
            timer.after(300, function () {
                ToggleSpriteCanBeHit(otherSprite, true)
            })
            pauseUntil(() => otherSprite.isHittingTile(CollisionDirection.Bottom))
            characterAnimations.setCharacterAnimationsEnabled(otherSprite, true)
            if (sprites.readDataBoolean(sprite, "Burn")) {
                otherSprite.startEffect(effects.fire, 5000)
                sprites.setDataBoolean(otherSprite, "OnFire", true)
                for (let index = 0; index < randint(5, 20); index++) {
                    SetSpriteHP(otherSprite, sprites.readDataNumber(otherSprite, "HP") + 1)
                    pause(1000)
                }
                sprites.setDataBoolean(otherSprite, "OnFire", false)
            }
            timer.after(300, function () {
                otherSprite.setFlag(SpriteFlag.GhostThroughSprites, false)
            })
        }
    }
})
sprites.onOverlap(SpriteKind.Enemy, SpriteKind.Player, function (sprite, otherSprite) {
    if (sprites.readDataBoolean(sprite, "Attacking")) {
        if (sprites.readDataBoolean(otherSprite, "CanBeHit")) {
            controller.player1.moveSprite(otherSprite, 0, 0)
            scene.cameraShake(4, 500)
            characterAnimations.setCharacterAnimationsEnabled(otherSprite, false)
            otherSprite.vy += 0 - (sprites.readDataNumber(otherSprite, "HP") + sprites.readDataNumber(sprite, "Damage") / 2)
            otherSprite.vx = sprites.readDataNumber(sprite, "Dir") * 2
            ToggleSpriteCanBeHit(otherSprite, false)
            ToggleSpriteAttacking(otherSprite, false)
            SetSpriteHP(otherSprite, sprites.readDataNumber(sprite, "Damage") + sprites.readDataNumber(otherSprite, "HP"))
            if (sprites.readDataBoolean(sprite, "Drain")) {
                if (sprites.readDataNumber(sprite, "HP") >= 10) {
                    SetSpriteHP(sprite, sprites.readDataNumber(sprite, "HP") - 10)
                }
            }
            timer.after(300, function () {
                ToggleSpriteCanBeHit(otherSprite, true)
            })
            pauseUntil(() => otherSprite.isHittingTile(CollisionDirection.Bottom))
            characterAnimations.setCharacterAnimationsEnabled(otherSprite, true)
            controller.player1.moveSprite(otherSprite, SpeedStats[Player1Character], 0)
            if (sprites.readDataBoolean(sprite, "Burn")) {
                otherSprite.startEffect(effects.fire, 5000)
                sprites.setDataBoolean(otherSprite, "OnFire", true)
                for (let index = 0; index < randint(5, 13); index++) {
                    SetSpriteHP(otherSprite, sprites.readDataNumber(otherSprite, "HP") + 1)
                    pause(1000)
                }
                sprites.setDataBoolean(otherSprite, "OnFire", false)
            }
        }
    }
})
controller.left.onEvent(ControllerButtonEvent.Pressed, function () {
    if (SelectOption) {
        if (CurrentSelection > 0) {
            CurrentSelection += -1
        }
    } else if (SelectingMap) {
        if (MapSelection > 0) {
            MapSelection += -1
            MapSelectArrow.x = Maps[MapSelection].x
        }
    } else if (SelectGamemode) {
        if (ModeSelection > 0) {
            ModeSelection += -1
            GamemodeSelectArrow.x = GamemodeSelect[ModeSelection].x
        }
    }
})
function ToggleSpriteCanBeHit (Selected: Sprite, CanBeHit: boolean) {
    sprites.setDataBoolean(Selected, "CanBeHit", CanBeHit)
}
scene.onOverlapTile(SpriteKind.Enemy, assets.tile`myTile67`, function (sprite, location) {
    tiles.placeOnRandomTile(sprite, assets.tile`myTile61`)
    sprite.setFlag(SpriteFlag.GhostThroughTiles, true)
    timer.after(2000, function () {
        sprite.setFlag(SpriteFlag.GhostThroughTiles, false)
    })
})
sprites.onOverlap(SpriteKind.Projectile, SpriteKind.Trap, function (sprite, otherSprite) {
    sprites.destroy(sprite)
    sprites.destroy(otherSprite)
})
