function ChangeLoadingBy (RandomNumber: number) {
    if (LoadingAnimations.get_loading_value(LoadingAnimations.LoadingValue.Current) < LoadingAnimations.get_loading_value(LoadingAnimations.LoadingValue.Maximum)) {
        LoadingAnimations.change_loading_value(LoadingAnimations.LoadingValue.Current, RandomNumber)
        pause(randint(50, 1000))
        ChangeLoadingBy(randint(2, 15))
    }
}
scene.onOverlapTile(SpriteKind.Player, assets.tile`myTile32`, function (sprite, location) {
    if (sprites.readDataNumber(sprite, "HP") < MaxHealth) {
        SetSpriteHP(sprite, MaxHealth)
    }
})
