forever(function () {
    if (InBattle) {
        if (sprites.readDataBoolean(mySprite, "CanBeHit")) {
            if (!(sprites.readDataBoolean(mySprite, "Attacking"))) {
                controller.moveSprite(mySprite, SpeedStats[Player1Character], 0)
            }
        } else if (!(sprites.readDataBoolean(mySprite, "CanBeHit"))) {
            controller.moveSprite(mySprite, 0, 0)
        }
        if (Multiplayer) {
            if (sprites.readDataBoolean(Player2, "CanBeHit")) {
                if (!(sprites.readDataBoolean(Player2, "Attacking"))) {
                    controller.player2.moveSprite(Player2, SpeedStats[Player2Character], 0)
                }
            } else if (!(sprites.readDataBoolean(Player2, "CanBeHit"))) {
                controller.player2.moveSprite(Player2, 0, 0)
            }
        } else if (!(Multiplayer)) {
            if (sprites.readDataBoolean(Player2, "CanBeHit")) {
                if (!(sprites.readDataBoolean(Player2, "Attacking"))) {
                    Player2.vx = sprites.readDataNumber(Player2, "VXMOVEMENT")
                }
            } else if (!(sprites.readDataBoolean(Player2, "CanBeHit"))) {
                Player2.vx = 0
            }
        }
    }
})
forever(function () {
    if (InBattle) {
        if (controller.left.isPressed()) {
            SetSpriteDirection(mySprite, -100)
        } else if (controller.right.isPressed()) {
            SetSpriteDirection(mySprite, 100)
        }
        if (Multiplayer) {
            if (controller.player2.isPressed(ControllerButton.Left)) {
                SetSpriteDirection(Player2, -100)
            } else if (controller.player2.isPressed(ControllerButton.Right)) {
                SetSpriteDirection(Player2, 100)
            }
        }
    }
})
forever(function () {
    if (InBattle) {
        Player1DamageText.setText("" + sprites.readDataNumber(mySprite, "HP") + "%")
        Player2DamageText.setText("" + sprites.readDataNumber(Player2, "HP") + "%")
    }
})
game.onUpdateInterval(500, function () {
    if (InBattle) {
        for (let value of sprites.allOfKind(SpriteKind.Cannon)) {
        	
        }
    }
})
game.onUpdateInterval(500, function () {
    if (InBattle) {
        if (CurrentGamemode == 2) {
            scene.cameraShake(2, 300)
            SetSpriteHP(Player2, sprites.readDataNumber(Player2, "HP") + 2)
            timer.after(3, function () {
                SetSpriteHP(mySprite, sprites.readDataNumber(mySprite, "HP") + 2)
            })
        }
    }
})
forever(function () {
    if (SelectOption) {
        SelectArrow.x = Boxes[CurrentSelection].x
    }
})
game.onUpdateInterval(1000, function () {
    if (InBattle) {
        if (CurrentGamemode == 4) {
            if (sprites.readDataNumber(Player2, "HP") >= 2) {
                Player2.startEffect(effects.hearts, 500)
                SetSpriteHP(Player2, sprites.readDataNumber(Player2, "HP") - 2)
            }
            if (sprites.readDataNumber(mySprite, "HP") >= 2) {
                mySprite.startEffect(effects.hearts, 500)
                SetSpriteHP(mySprite, sprites.readDataNumber(mySprite, "HP") - 2)
            }
        }
    }
})
forever(function () {
    if (SelectingMap) {
        MapText.setText(ArenaNames[MapSelection])
        MapSelectArrow.y = Maps[MapSelection].y - 20
        MapSelectArrow.x = Maps[MapSelection].x
    }
})
